$("#search_input").keypress(function (){
	buscar(getId("search_input").value);
});

function buscar(a) {
	var temp = [];
	for (var i = 0; i < bd_Name.length; i++) {
	var b = bd_Name[i].toLowerCase();
	var c = a.toLowerCase();
		if (b.indexOf(c)!= -1) {
			temp.push(i);
		}
	}
	mostrarBusqueda(temp);

}
function mostrarBusqueda(a) {
	var temp="";
	for (var i = 0; i < a.length; i++) {
		temp+="<div> <img src=\""+bd_Poster[a[i]]+"\"> <p>"+bd_Name[a[i]]+"</p> </div>";
	}
	$("#ResulSearch").html(temp);
	
	

}


function getId(id){return document.getElementById(id)}
